const styles = {
    container: {
        width: "300px",
        margin: "50px auto",
        padding: "20px",
        border: "1px solid #ccc",
        borderRadius: "8px",
        textAlign: "center",
        backgroundColor: "#f9f9f9",
    },
    form: {
        display: "flex",
        flexDirection: "column",
        gap: "10px",
    },
    error: {
        color: "red",
        fontSize: "14px",
    },
    success: {
        color: "green",
        fontSize: "14px",
    },
    imagePreview: {
        width: "100px",
        height: "100px",
        borderRadius: "50%",
        objectFit: "cover",
        marginTop: "10px",
    },
};

export default AdminSignup;
